import React, { Component } from 'react'
import Hero from '../components/hero/hero'
import AboutUs from '../components/aboutus/aboutus'
import Plans from '../components/plans/plans'
import MVV from '../components/mvv/mvv'
import Team from '../components/team/team'

class HomePage extends Component {
    render() {
        return(
            <div>
                <Hero/>
                <AboutUs highlight={process.env.REACT_APP_SECTION_BACKGROUND}/>
                <Plans   highlight={process.env.REACT_APP_SECTION_HIGHLIGHT}/>
                <MVV     highlight={process.env.REACT_APP_SECTION_BACKGROUND}/>
                <Team   />
            </div>
        )
    }
}

export default HomePage
